import * as React from "react";
export const Header = () =>
  React.createElement(
    "header",
    null,
    React.createElement("img", {
      className: "logo",
      src: "images/woo_tit.svg",
      alt: "\uBB3C\uB77C\uC96C \uBA5C\uB791\uCF5C\uB9AD"
    })
  );
